import { createAsyncThunk } from "@reduxjs/toolkit"
export const loginUserThunk=createAsyncThunk(
    'userLogin',
    async (payload)=>{
        const user =await getRequest(payload.url)
        if(user.success){
            return user
        }
    }
)
